description:
View videos in Xamarin Forms with the VideoView control.
		
		This control is designed as a display view of the video, not a video controller (no buttons). The coming sample XAML project will give an example of how to use.
		
		Usage:
			xmlns:roxv="clr-namespace:Rox;assembly=Rox.Xamarin.Video.Portable"
			
			<roxv:VideoView AutoPlay="True" LoopPlay="True" VideoSource="http://www.sample-videos.com/video/mp4/720/big_buck_bunny_720p_1mb.mp4" />

		The VideoView has the following methods:
		 - Task Start();
		 - Task Pause();
		 - Task Stop();
		 
		The VideoView has the following bindable properties:
		 - bool AutoPlay { get; set; }
		 - bool LoopPlay { get; set; }
		 - string VideoSource { get; set; }
		    NOTE: The VideoSource must be a valid URI for iOS and UWP, but can be a valid URI or a FileName in Andriod.
		
		Future Bindable Properties:
		 - VideoState { get; }

		NOTE: All Rox.Xamarin components support Xamarin.Forms for Portable, Android, iOS, and UWP only. May be future support for OSX.

